import React from 'react';
import '../Sidebar.css';
import logo from '../assets/logo.jpg';  // Adjust the path according to your project structure

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="logo">
        <img src={logo} alt="Logo" className="logo-image" />
      </div>
      <div className="menu">
        <button>Dashboard Overview</button>
        <button>Geospatial Map</button>
        <button>Charts & Graphs</button>
        <button>ISP Leaderboard</button>
        <button>History Analysis</button>
      </div>
    </div>
  );
};

export default Sidebar;
